import * as React from 'react';

export const ThreeColumnCard = ({ children, title, description }) => {
  return (
    <>
      <div className='w-1/3'>
        <div className='w-90p'>
          <div>
            <div>{children}</div>
          </div>
          <div className='my-4'>
            <h3
              style={{ fontFamily: 'airbnb-bold' }}
              className='text-gray-750 text-2xl'>
              {title}
            </h3>
          </div>
          <div>
            <p style={{ fontFamily: 'airbnb-book' }} className='text-gray-750'>
              {description}
            </p>
          </div>
        </div>
      </div>
    </>
  );
};
